import React from 'react';

function lineup({name}) {
  return <h1>Today's player is {name}</h1>;
};

const roaster = [
  {
    name: 'Messi',
    image: 'lineup1'
  },
  {
    name: 'Suarez',
    image: 'lineup2'
  }
];

function App() {
  return (
    <div>
      lineup list
      {roaster.map(player => (
        <lineup name = {player.name} />
      ))}
    </div>
  );
}

export default App;
